function isWhitespace(c){
return c===' '||c==='\n'||c==='\r'||c==='\t';
}

function isQuote(c){
return c==='"'||c==='\'';
}

function isAttribEnd(c){
return c==='>'||isWhitespace(c);
}

function isMatch(regex,c){
return regex.test(c);
}

function notMatch(regex,c){
return!isMatch(regex,c);
}

